import './App.css';
import Banner from './Components/Banner/Banner';
import Navbar from './Components/Navbar';
import RowPost from './Components/Rowpost/RowPost';
import  urls  from './url';

function App() {
  return (
    <div className="App">
        <Navbar/>
        <Banner/>
        <RowPost url={urls.originals} title='Netflix Originals'/>
        <RowPost url={urls.action} title='Action' isSmall/>
        <RowPost url={urls.comedy} title='Comedy'/>
        <RowPost url={urls.romance} title='Romance' isSmall/>
        <RowPost url={urls.horror} title=' H'/>
    </div>
  );
}

export default App;
